import styles from "./NewUser.module.css";

const NewUser = (props) => {
  return (
    <input
      className={styles.input}
      type="text"
      value={`${props.newUser.username} (${props.newUser.age} years old)`}
      onChange={2}
    />
  );
};
export default NewUser;
